    verifyProtocol: (url) => {

        if (/^\S*:/i.test(url)) {

            for (let i = 0; i < Object.keys(browser.protocols).length; i++) {
                const protocol = Object.keys(browser.protocols)[i];

                if (RegExp("^border:\/*" + protocol).test(url)) {
                    return "data:text/html," + encodeURIComponent(browser.protocols[protocol]);
                }
            }
            for (let i = 0; i < Object.keys(browser.otherBuiltins).length; i++) {
                const protocol = Object.keys(browser.otherBuiltins)[i];

                if (RegExp(protocol).test(url)) {
                    return "data:text/html," + encodeURIComponent(browser.otherBuiltins[protocol]);
                }
            }
            return url;
        } else {
            return "https://" + url;
        }

    },
    getCorrectUrl:function(u){
		var pk=Object.keys(browser.protocols);
		for(var i=0;i<pk.length;i++){
			if(u===browser.verifyProtocol('border://'+pk[i])){
				return "border://"+pk[i];
			}
		}
		var pk=Object.keys(browser.otherBuiltins);
		for(var i=0;i<pk.length;i++){
			if(u==="data:text/html,"+encodeURIComponent(browser.otherBuiltins[pk[i]])){
				return pk[i];
			}
		}
		return u
	},
