function getAllBorderURLs() {
    var links="";
    var prot=Object.keys(browser.protocols);
    for(var i=0;i<prot.length;i++) {
        if(prot[i]=="urls") {
            links+="<a style='color:white' href='javascript:location.reload()'>border://urls</a>"
        } else {
            links+=`<a style='color:white' href="${browser.verifyProtocol('border://'+prot[i])}">border://${prot[i]}</a>`;
        }
        links+=`<br>`
    }
    return `<!DOCTYPE html>
            <html lang="en" style="width:100vw;height:100vh;margin:0;background-color:indigo;">
            <head>
                <meta charset="UTF-8">
                <meta http-equiv="X-UA-Compatible" content="IE=edge">
                <meta name="viewport" content="width=device-width, initial-scale=1.0">
                <title>Border urls</title>
                <link rel="preconnect" href="https://fonts.googleapis.com">
                <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
                <link href="https://fonts.googleapis.com/css2?family=Lexend&display=swap" rel="stylesheet">
            </head>
            <body style="width: calc(100vw - 30px * 2); height: calc(100% - 30px * 2); overflow: auto; font-family: 'Lexend', sans-serif; padding: 30px; margin: 0; color: white;">
                <img style="display: inline-block; width: 150px;" src="data:image/png;base64,">
                <span style="display: inline-block; font-size: 50px;">&nbsp;urls</span>
                
                <ul>
                ${links}
                </ul>
            </body>
        </html>`
}


